      window.reportProps["appData"] = { data: { result: {"view_xml": "\u003cView version=\"1\" fragment=\"false\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"Overview\" columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[## Compare Whoop 5.0 vs Amazfit Helio Strap.\n\nLa seguente dashboard confronta i dati raccolti da Whoop 5.0 e Amazfit Helio Strap. Vedi la recensione completa qui \ud83d\udc47\n\n[Amazfit Helio Strap: Dov\u0027\u00e8 la fregatura rispetto a Whoop?](https://youtu.be/spY5iUtKxQw) by Danilo Fiumi]]\u003e\u003c/Text\u003e\u003cHTML\u003e\u003c![CDATA[\u003cimg width=600 src=\u0027https://i.ytimg.com/vi/spY5iUtKxQw/hqdefault.jpg?sqp=-oaymwEnCNACELwBSFryq4qpAxkIARUAAIhCGAHYAQHiAQoIGBACGAY4AUAB\u0026rs=AOn4CLATDvosSWE9vUVijcqunWHhpvtj1Q\u0027\u003e]]\u003e\u003c/HTML\u003e\u003cText\u003e\u003c![CDATA[# \u2139\ufe0f Riferimento Metriche\n\n### **HRV (Heart Rate Variability)**\n\n- **Cos\u2019\u00e8**: la variabilit\u00e0 degli intervalli tra un battito e l\u2019altro.\n\n- **Perch\u00e9 \u00e8 importante**:\n    - \u00c8 uno dei migliori indicatori dello stato del **sistema nervoso autonomo**.\n    - Un HRV alto \u2192 indica che sei riposato, adattabile, pronto ad affrontare stress o allenamento.\n    - Un HRV basso \u2192 segnala affaticamento, stress, mancanza di recupero.\n\n- **Insight**: serve a capire se il corpo \u00e8 in fase di recupero o in sovraccarico.\n---\n\n### **RHR (Resting Heart Rate \u2013 Frequenza Cardiaca a Riposo)**\n\n- **Cos\u2019\u00e8**: i battiti al minuto quando sei completamente a riposo.\n\n- **Perch\u00e9 \u00e8 importante**:\n    - Un RHR pi\u00f9 basso nel tempo \u00e8 segno di buona fitness cardiovascolare.\n    - Un RHR pi\u00f9 alto del solito \u2192 pu\u00f2 indicare stress, fatica o che stai combattendo un\u2019infezione.\n\n- **Insight**: \u00e8 un segnale rapido e semplice per capire lo stato generale del corpo.\n\n\n---\n\n### **Sonno**\n\n- **Cos\u2019\u00e8**: quantit\u00e0 e qualit\u00e0 del riposo notturno (cicli REM, sonno profondo, latenza, efficienza).\n\n- **Perch\u00e9 \u00e8 importante**:\n    - Il sonno \u00e8 il **principale strumento di recupero** del corpo e del cervello.\n    - Senza sonno adeguato, HRV cala, RHR aumenta, e la capacit\u00e0 di performare peggiora.\n\n- **Insight**: Whoop usa il sonno per calcolare quanto sei pronto a sostenere sforzi.\n\n\n---\n\n### **Frequenza Cardiaca durante il Workout**\n\n- **Cos\u2019\u00e8**: andamento della frequenza cardiaca durante esercizi e sforzo.\n\n- **Perch\u00e9 \u00e8 importante**:\n    - Permette di stimare il **carico cardiovascolare** e metabolico di ogni sessione.\n    - Viene usato per calcolare lo **Strain** (quanto stress fisico hai accumulato).\n\n- **Insight**: aiuta a capire se il livello di sforzo \u00e8 in linea con il tuo recupero.\n\n\n---\n\n### **Tasso di Respirazione**\n\n- **Cos\u2019\u00e8**: il numero di respiri al minuto, soprattutto durante il sonno.\n\n- **Perch\u00e9 \u00e8 importante**:\n    - \u00c8 un parametro molto stabile: variazioni possono indicare stress, malattia o problemi respiratori.\n    - Monitorato di notte d\u00e0 segnali precoci di infezioni (es. febbre, influenza, Covid).\n\n- **Insight**: usato come segnale \u201cearly warning\u201d per problemi di salute o affaticamento.\n\n---\n\n### **\ud83d\udd11 Perch\u00e9 sono i dati principali?**\n\nPerch\u00e9 **coprono i tre pilastri della performance e del recupero**:\n1. **Recupero fisiologico** \u2192 HRV + RHR\n2. **Riposo e rigenerazione** \u2192 Sonno\n3. **Carico di allenamento** \u2192 FC durante workout\n4. **Stato di salute generale** \u2192 Tasso di respirazione]]\u003e\u003c/Text\u003e\u003c/Group\u003e\u003cGroup label=\"HRV + RHR + Respiratory Rate\" columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[## Compare Whoop 5.0 vs Amazfit Helio Strap\n\n### HRV - Heart Rate Variability]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.vegalite.v5+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://0a445665f8\"/\u003e\u003cText\u003e\u003c![CDATA[### RHR - Resting Heart Rate]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.vegalite.v5+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://011413793b\"/\u003e\u003cText\u003e\u003c![CDATA[### Respiratory Rate]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.vegalite.v5+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://3281ed3974\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Sleep\" columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[## Compare Whoop 5.0 vs Amazfit Helio Strap\n\n### Fasi del sonno categorizate da Apple Health per Zepp e da Export Whoop per whoop 5.0 (rimappate)]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.vegalite.v5+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://0ef6818efb\"/\u003e\u003cText\u003e\u003c![CDATA[### Fasi del sonno da Apple Health aggragate e rimappate per compatibilit\u00e0]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.vegalite.v5+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://df2532c9b6\"/\u003e\u003cText\u003e\u003c![CDATA[whoop exporta su apple health solo 3 fasi mentre zepp ne ha 5\n\n### Confronto Awake e In bed tra i device da Apple Health]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.vegalite.v5+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://055c2e73f0\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Workout\" columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[## Compare Whoop 5.0 vs Amazfit Helio Strap.]]\u003e\u003c/Text\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"06-09-2025\" columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[## \ud83d\udcaa Workout del 06-09-2025\n\n### Confronto battiti cardiaci]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.vegalite.v5+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://f25a0a7d3a\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://57722ce8f3\"/\u
